import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Header from './Componentes/Header/header';
import Main from './Componentes/Main/main';
import Cadastro from './Componentes/Cadastro/cadastro';

function App() {
  return (
     <BrowserRouter>
      <div className="App">
        <Header /> 

        {/* 3. As <Routes> definem o conteúdo da página com base na URL */}
        <Routes>
          {/* Rota Raiz: Usada para a tela de Login/Principal */}
          <Route path="/" element={<Main />} /> 

          {/* Rota de Cadastro: Acessada via /cadastro */}
          <Route path="/cadastro" element={<Cadastro />} /> 

          {/* Rota da Tela Inicial (Acessada após o login) */}
          <Route path="/inicio" element={<TelaInicio />} /> 

          {/* Você pode adicionar a rota de Saque e Depósito aqui */}
          {/* <Route path="/saque" element={<TelaSaque />} /> */}
        </Routes>

      </div>
    </BrowserRouter>
  );
}

export default App;
